import React from 'react';
import Navbar from './components/Navbar';
import HomeSection from './components/HomeSection';
import AboutSection from './components/AboutSection';
import ExperienceSection from './components/ExperienceSection';
import ProjectsSection from './components/ProjectsSection';
import ParallaxBackground from './components/ParallaxBackground'; // Import the ParallaxBackground component

function App() {
  return (
    <div>
      <Navbar />
      <ParallaxBackground><HomeSection /></ParallaxBackground>
      <ParallaxBackground><AboutSection /></ParallaxBackground>
      <ParallaxBackground><ExperienceSection /></ParallaxBackground>
      <ParallaxBackground><ProjectsSection /></ParallaxBackground>
    </div>
  );
}

export default App;
